const fs = require('fs').promises;

// Function to convert IP string to uint32
function ipToUint32(ip) {
    return ip.split('.')
        .reduce((acc, octet) => (acc << 8) + parseInt(octet), 0) >>> 0;
}

// Function to convert uint32 back to IP string
function uint32ToIp(num) {
    return [
        (num >>> 24) & 255,
        (num >>> 16) & 255,
        (num >>> 8) & 255,
        num & 255
    ].join('.');
}

async function processIPs() {
    try {
        // 1. Read IP addresses from file
        const data = await fs.readFile('ips.txt', 'utf8');
        
        // 2. Extract IPs using regex
        const ipRegex = /\b(?:\d{1,3}\.){3}\d{1,3}\b/g;
        const ipAddresses = data.match(ipRegex) || [];
        
        // 3. Convert IPs to uint32 array
        const uint32Array = ipAddresses.map(ipToUint32);
        
        // 4. Create buffer for binary data (4 bytes per IP)
        const buffer = Buffer.alloc(uint32Array.length * 4);
        uint32Array.forEach((num, index) => {
            buffer.writeUInt32BE(num, index * 4);
        });
        
        // 5. Write binary file
        await fs.writeFile('ips.bin', buffer);
        console.log('Binary file written successfully');
        
        // 6. Read binary file back
        const binaryData = await fs.readFile('ips.bin');
        
        // 7. Convert back to IP addresses
        const recoveredIps = [];
        for (let i = 0; i < binaryData.length; i += 4) {
            const uint32 = binaryData.readUInt32BE(i);
            recoveredIps.push(uint32ToIp(uint32));
        }
        
        // 8. Display results
        console.log('Original IPs:', ipAddresses);
        console.log('Recovered IPs:', recoveredIps);
        
    } catch (error) {
        console.error('Error:', error);
    }
}

// Example usage
processIPs();

using System;

namespace ConsoleApp3
{
    internal class Program
    {
        static void Main(string[] args)
        {
            int matrixRows = 10;
            int matrixColumns = 10;
            int[,] matrix = new int[matrixRows, matrixColumns];

            Random random = new Random();
            int randomMaxRange = 100;
            int randomMinRange = 10;

            int minimalValue = int.MinValue;

            for (int i = 0; i < matrix.GetLength(0); i++)
            {
                for (int j = 0; j < matrix.GetLength(1); j++)
                {
                    matrix[i, j] = random.Next(randomMinRange, randomMaxRange);
                    Console.Write(matrix[i, j] + " ");
                }

                Console.WriteLine();             
            }

            for (int i = 0;i < matrix.GetLength(0); i++)
            {
                for(int j = 0;j < matrix.GetLength(1); j++)
                {
                    if (matrix[i, j] > minimalValue)
                    {
                        minimalValue = matrix[i, j];
                    }
                } 
            }

            Console.WriteLine();

            for (int i = 0; i < matrix.GetLength(0); i++)
            {
                for (int j = 0; j < matrix.GetLength(1); j++)
                {
                    if (matrix[i, j] == minimalValue)
                    {
                       matrix[i, j] = 0;
                    }

                    Console.Write(matrix[i, j] + " ");
                }

                Console.WriteLine();
            }

            Console.WriteLine(minimalValue);
        }
    }
}
